javascriptCode.code:
let channel = record.current // Our main dependencies are candles
variable.count.all++

if (channel.direction === "Up") {

    variable.count.up++

    if (channel.period > variable.max.up) { variable.max.up = channel.period }

    if (channel.period <= variable.MAX_PERIODS) {
        let data = variable.arrayUp[channel.period]
        data.count++
        data.probability = data.count / variable.count.up
        variable.arrayUp[channel.period] = data
    }

    for (let i = 1; i <= variable.MAX_PERIODS; i++) {
        if (channel.period > i) {
            let data = variable.arrayUp[i]
            data.greaterCount++
            data.greaterProbability = data.greaterCount / variable.count.up
            variable.arrayUp[i] = data
        }
    }
}

if (channel.direction === "Down") {

    variable.count.down++

    if (channel.period > variable.max.down) { variable.max.down = channel.period }

    if (channel.period <= variable.MAX_PERIODS) {
        let data = variable.arrayDown[channel.period]
        data.count++
        data.probability = data.count / variable.count.down
        variable.arrayDown[channel.period] = data
    }

    for (let i = 1; i <= variable.MAX_PERIODS; i++) {
        if (channel.period > i) {
            let data = variable.arrayDown[i]
            data.greaterCount++
            data.greaterProbability = data.greaterCount / variable.count.up
            variable.arrayDown[i] = data
        }
    }
}

if (channel.direction === "Side") {

    variable.count.side++

    if (channel.period > variable.max.side) { variable.max.side = channel.period }

    if (channel.period <= variable.MAX_PERIODS) {
        let data = variable.arraySide[channel.period]
        data.count++
        data.probability = data.count / variable.count.side
        variable.arraySide[channel.period] = data
    }

    for (let i = 1; i <= variable.MAX_PERIODS; i++) {
        if (channel.period > i) {
            let data = variable.arraySide[i]
            data.greaterCount++
            data.greaterProbability = data.greaterCount / variable.count.up
            variable.arraySide[i] = data
        }
    }
}

